import { Link } from "react-router-dom";
import styles from "./styles.module.css";
const axios = require('axios')
import { useContext } from "react";

function Login() {
	//const img 

	const googleAuth = () => {
		window.open(
			`http://localhost:8080/auth/google/callback`,
			"_self"
		);
	};

	const picOfDay = async (e) => {

		e.preventDefault();

		const API_KEY = "DPYKShDqOt0azgbgT3qogu4s4GMb1Tx3NMatW8gZ";

		const {data: imageData} = await axios.get(`https://api.nasa.gov/planetary/apod?api_key=${API_KEY}`)

		const body = `${imageData.date}, ${imageData.title}, ${imageData.explanation} `

	}

	//console.log(body)



	return (
		<div className={styles.container}>
			<h1 className={styles.heading}>Log in Form</h1>
			<div className={styles.form_container}>
				<div className={styles.left}>
					<img className={styles.img} src="./images/login.jpg" alt="login" />
				</div>
				<div className={styles.right}>
					<h2 className={styles.from_heading}>Members Log in</h2>
					<input type="text" className={styles.input} placeholder="Email" />
					<input type="text" className={styles.input} placeholder="Password" />
					<button className={styles.btn}>Log In</button>
					<p className={styles.text}>or</p>
					<button className={styles.google_btn} onClick={googleAuth}>
						<img src="./images/google.png" alt="google icon" />
						<span>Sing in with Google</span>
					</button>
					<p className={styles.text}>
						New Here ? <Link to="/signup">Sing Up</Link>
					</p>



				</div>
			</div>
		</div>
	);
}

export default Login;
